  [],\n\t\"revision_timestamp\": \"2016-07-27T22:48:55.146201\",\n\t\"name\": \"screening-level-contaminant-survey-of-the-sunkhaze-meadows-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The 9,337-acre Sunkhaze Meadows National
  Wildlife Refuge is located in the Town of Milford, Maine. Along the refugeu2019s
  southern boundary is the former Town of Milford Municipal Landfill. It was closed
  and capped in 1995. The Fort James Corporation operated a paper mill sludge landfill
  along the northern edge of the refuge between 1978 and 1996. In July 1993, three
  pairs of surface water and sediment samples were collected from locations along
  the refuge border and within the refuge from Baker Brook, Buzzy Brook and Sunkhaze
  Stream. Later in the same summer, chain pickerel and yellow perch were collected
  from two Sunkhaze Stream locations within the refuge, at the confluence of Baker
  Brook and at the confluence with Buzzy Brook. Water, sediment, and fish samples
  were analyzed for various contaminants including trace elements, organophosphate
  pesticides, organochlorine pesticides, polychlorinated biphenyls (PCBs), dioxins,
  and furans. The purposes of this screening level survey were: (1) to determine baseline
  levels of environmental contaminants on Sunkhaze Meadows National Wildlife Refuge
  and (2) to assess the impact of potential contaminant sources located adjacent to
  the refuge.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
